R["oh__@dromede"]="{['Version']=1773,['Key']='oh__@dromede',['TS']=1728250468,['na']={[64]={['D']='A home of Ulville Thontvella, a Dunmer Dragonknight who manage to (almost) cure herself of the vampiric curse with the help of alchemy and enchanting. Still somewhat photo-sensitive, she grows the plants she needs indoors.\\nNot very social at first, she slowly grew to embrace the \"Witch of the Wilds\" title given to her by the Arginian neighbors, and now she frequently helps them by making healing potions for the nearby village.',['C']=1.020000,['O']=20002,['N']='Witchy Indoor Lair',},[74]={['D']='This is a concept of a hotel :) It has two private VIP rooms, 2 smaller rooms for guests, and outside lodging for those who prefer more adventure and a private beach access. It has a small area for marriage ceremonies, as well as a secret meditation grove for worshipping the 8 Divines. ',['C']=1.021000,['O']=20002,['N']='Dream Vacation Elope',},[19]={['D']='This bakery is definitely not associated with any kind od cult... Why would you bring it up?',['N']='Kragenmoor House',['O']=19046,['C']=1.048000,},[76]={['D']='Babylonian Hanging Gardens reimagined.\\nThis Bangkorai version of the Gardens is powered by blue magical crystals, making water abundant in otherwise harsh and dry desert environment.',['N']='Semiramida Gardens',['O']=20002,['C']=1.021000,},[86]={['D']='',['N']='Ancient Elven Baths ',['O']=20002,['C']=1.014000,},},}"
