R["oh__@linvak.tukal"]="{['Version']=1773,['TS']=1724132173,['na']={[81]={['C']=1.007000,['D']='Come visit the private home of this faraway member of House Ravenwatch! Rumors stir around this mysterious abode and what happens within. Some say House Dres and Telvanni are always invited in.',['N']='House Drasnia',['O']=19230,},[34]={['C']=1.026000,['D']='The starter home of a Khajiiti couple who met under the moons and married in their light. A warm, welcoming abode adorned with personal trinkets, adventuring treasures, and a spare bed for weary travelers. The quaint home is nestled in the sands of Bangkorai, and is a celebration of love, laughter, and happy memories.',['N']='Their First House',['O']=19955,},[99]={['C']=1.038000,['D']='As the heavy mist settles in your hear the sound of chains, rigging, and the hull of a large ship approach. Welcome aboard Cair Sanguis, the far reaching merchant arm of the small and mysterious House Drasnia. This fine ship is currently crewed by the leaders of the house itself, Captain Little Drasnian and First Mate Dalarya Serayne. Let your ill begotten goods find safe passage and if you so dare, perhaps even yourself. Best of luck.',['N']='Cair Sanguis',['O']=19619,},[49]={['C']=1.038000,['D']='Where does an ex-Icereach Witch go when she no longer agrees with her clan? Accepted enough to claim her own territory this relocated witch keeps a hole into the realm of Takubar open as she channels the icy winds of the frozen north and beyond. Welcome to the home of Anahzga Frostthorn.',['N']='Ex-Icereach Witch',['O']=19955,},[70]={['C']=1.007000,['D']='Sail into the docks of Lunar Hearts Retreat and take in the stunning scenery from one of our many designated viewpoints around the serene waterfall. Take a walk around the historic grounds and learn about Khajiiti heritage! Head on up to the cozy lounge, see where the Guardians of Elsweyr conduct diplomacy with political visitants, and enjoy magical artifacts from Tamriel! The Guardians invite you to appreciate their quarters, but please no sitting on the bed. Try to find M\\'aiq!',['N']='Lunar Hearts Retreat',['O']=19200,},[26]={['C']=1.043000,['D']='Oh. You\\'ve received an invite to the Recondite Reservoir? We\\'re a small demiplane/pocket plane filled with a bar, a small library, and a hidden portal nexus for the bars owner, a cursed shifting Dremora known as Vaerindi Graylorin. You can only gain access if you\\'ve been shown the way the portal in, and this neutral ground is heavily enforced as a way for entities of all kinds to relax quietly and share information. Grab a drink of some persuasion, grab a book, and barter what you know.',['N']='Recondite Reservoir',['O']=19866,},},['Key']='oh__@linvak.tukal',}"
