R["oh__@shterion"]="{['Version']=1773,['eu']={[32]={['N']='Windmill Town',['D']='You\\'ve seen an Alinor windmill from the outside - but here in Windmill Town, you can also visit one from the inside! The town\\'s main windmill is open to visitors, and also functions as the library and town center. Spring is a good time to visit, because the mill is out of work and it\\'s grinder is detached from the rotor for your safety.\\r\\n\\r\\nWalking and first-person view are highly recommended! Also, please leave the lights and the fountains on - or turn them on if you see them off.',['O']=19077,['C']=1.041000,},[33]={['N']='Blue Sunflower House',['D']='Just outside a walled aristocratic castle, a small wooden house, painted in blue, overlooks a vast sunflower field. Here, the workers who toil the sunflower field live a more modest (but not less fulfilling) life, always in touch with the magic of nature!\\n\\nP.S. probably my best house so far, do stop by!',['O']=19315,['C']=1.047000,},[36]={['N']='Gardens of Babylon',['D']='The Hanging Gardens of Babylon are historically attested in ancient sources, although no archeological evidence has been found to prove they existed. This fact, along with the many stories about their creation, make them a sort of folklore legend of ancient times. Many other players have created great builds with the same name, but I aim for more historical accuracy in recreating the gardens. \\r\\n\\r\\nCheck out the Hanging Gardens video on my YouTube channel (@shterion3028) for more information\\r\\n',['O']=19651,['C']=1.021000,},[21]={['N']='Autumn Wooden Cabin',['D']='A wooden cabin in autumn! \\rIt\\'s my best build so far, feel free to visit, roleplay, move in :)\\n\\r\\nHint 1: Opening the window shutter on the upper floor may not be intuitive, look for the handles at both sides of the furnishing and the window.\\r\\n\\r\\nHint 2: There\\'s currently an ongoing bug that might be triggered, wherein lightning furnishings, while turned on, don\\'t brighten up anything around them. I\\'ll give you visitor access, so if the bug triggers, you can turn all the lights off and on again',['O']=18972,['C']=1.031000,},[6]={['N']='The Club',['D']='Come to the goth club tonight for a live performance of your favorite Khajiit singer and her band! Grab some drinks at the bar too, to support the venue!',['O']=18868,['C']=1.048000,},[23]={['N']='Treehouse community',['D']='Visit this goofy but (mostly) pleasant treehouse community! Make sure to check every corner and open every door you can, surprises await ;)',['O']=18889,['C']=1.031000,},[40]={['N']='Kame House',['D']='Kame House from Dragonball!\\n\\nReadme (for diehard DB fans only): Welcome back to Kame House, space-time traveler! Much has changed since you last came. Much of the house\\'s paint has faded, Roshi\\'s so old he often sleeps, Puar\\'s hair is all white, Oolong has become a hedonist, Turtle\\'s skin turned green, and even a certain sayan has grown back his tail. Only Launch seems welcoming - she even switched her weapons for a more medieval styled gear, to honor you and the universe you hail from. Enjoy!',['O']=19254,['C']=1.046000,},[14]={['N']='Rumors in Brickville',['D']='Have you heard the rumors about Brickville? Two thieves broke into the house of the powerful Arelas family. The owners heard and sounded the alarm, so the thieves ran and fell into the family’s basement, filled with books. Trying to find a way out, they opened a wardrobe... but tentacles pulled them into a pocket realm of Apocrypha! In it, magic tomes give the Arelas supernatural powers: shapeshifting and even controlling time! The thieves tried to escape and ended up in the town\\'s water supply.',['O']=19442,['C']=1.026000,},[20]={['N']='Forest Creature Home',['D']='If you enter the merry forest, outside an elven town, you’ll find the home of the forest creatures in a magical grove. It was constructed with the help of crafty elves who live nearby – you can still hear them working. The