R["oh__@rasuli"]="{['Key']='oh__@rasuli',['TS']=1701616369,['eu']={[64]={['D']='A long time ago there was a fisherman who enjoyed his home.....',['C']=1.021000,['O']=19207,['N']='Fisher\\'s Dance',},[36]={['D']='Madame Veyta fulfilled her heart\\'s desire and created a spa just for ladies - relaxation, recreation, sauna and solarium as well as a hairdresser\\'s corner. Finally!',['C']=1.014000,['O']=19158,['N']='Haus in Hundingshafen',},[37]={['D']='',['C']=1.021000,['O']=19545,['N']='COLORS, LIGHTS and..',},[70]={['D']='an asian style home',['C']=1.041000,['O']=19106,['N']='Omoi no Taki',},[71]={['D']='this is \"MAQUINARIA\" - a modern style villa in a natural paradise - enjoy!',['C']=1.021000,['O']=19416,['N']='\"MAQUINARIA\" ',},[104]={['D']='This is the home of the very unknown cousin-Coalblack-of a very famous personality-Snow White!\\r\\nCoalblack is obsessed with becoming a famous inventor-at this moment, that\\'s not on the horizon. She is desperate to invent a portal to another world, but so far has only managed to electrocute her house and mess up her new shoes. \\r\\nTo her credit, the test subjects were already dead, and if one thing is proven, it\\'s this: energising a dead druid may make him crispy, but it doesn\\'t teleport him at all!',['C']=1.020000,['O']=19650,['N']='Coalblack & NO DWARF',},[41]={['D']='',['C']=1.020000,['O']=19159,['N']='DarkElves\\' Sanctuary',},[74]={['D']='These are the remains of a once magnificent monastery. \\nThe gardens are still tended by the last 4 monks, who are now very old. \\nPlease be kind to the old men, thank you :-)',['C']=1.021000,['O']=19415,['N']='Gardens of Monastry',},[43]={['D']='Just relax...enjoy and have a hot dog ',['C']=1.021000,['O']=19276,['N']='Just relax .....',},[76]={['D']='Honoured guests!\\r\\nThis is the main entrance to Princess Shera\\'s palace!\\r\\nPlease forgive that the entrance to the actual palace is closed, the princess wants peace and privacy.\\r\\nHowever, this entrance area offers many opportunities to enjoy the beauty of the place and relax!\\r\\nAdmission is free!',['C']=1.021000,['O']=19384,['N']='Palace of Shera',},[46]={['D']='',['C']=1.037000,['O']=19648,['N']='Goldküste-Herrenhaus',},[15]={['D']='Please don\\'t eat the Mushrooms :-D',['C']=1.021000,['O']=19159,['N']='Mushrooms !',},[80]={['D']='..the half-sunken refuge of an elderly mage who is only able to see her surroundings through the crystals near her....the price for extensive magic!',['C']=1.021000,['O']=19286,['N']='The Crystal Tale',},[81]={['D']='...in the summertime...',['C']=1.021000,['O']=19224,['N']='...in the summertime',},[83]={['D']='The life of a druid is not easy - here those in need of rest find peace and quiet.',['C']=1.021000,['O']=19355,['N']='\"Beauty of Nature\"',},[20]={['D']='my home...small but mine :-D',['C']=1.021000,['O']=19177,['N']='Sha\\'Veyta\\'s Home',},[56]={['D']='Welcome to the Garden Centre!\\nAt the front you will find the cash desk, showroom and exhibition, at the back you will find the growing and planting basins. \\nPlease use baskets or trolleys for your shopping.\\nThank you for your visit!',['C']=1.021000,['O']=19570,['N']='GARDEN-CENTER ',},[27]={['D']='Love, Sex and Rock\\'n Roll ! ',['C']=1.021000,['O']=19188,['N']='Lonely Hearts\\' Club',},[61]={['D']='',['C']=1.037000,['O']=19648,['N']='Monk-Hideout',},[62]={['D']='AQUARIA- a simple holiday place to relax and feel good',['C']=1.020000,['O']=19165,['N']='AQUARIA',},},['Version']=1773,}"
