R["oh__@myrrha.o"]="{['Key']='oh__@myrrha.o',['TS']=1696175334,['eu']={[20]={['C']=1.500000,['D']='Reliquiae Tenebrarum\\r\\nAn exhibition of funerary art collections and ritualistic elements, featuring eclectic and mysterious objects gathered all around Tamriel and beyond.\\r\\nFor your enjoyment, you’ll find a cenotaph full of treasures, an eternal resting place and of course a boutique with all the necessary souvenirs.\\r\\n',['N']='Maison de Narsis',['O']=19624,},[28]={['C']=1.500000,['D']='Beware, brave adventurers, for you are about to enter a hidden place, nestled in the hills of the Rift, where Flooftail, brave and fierce warrior, protects the most valuable and revered artifact of his people, the wondrous walnut of wisdom! Enter at your own peril!',['N']='Maison de Nimalten',['O']=19624,},[18]={['C']=1.500000,['D']='Tea salon and shop\\r\\nWell established house in wayrest.\\r\\nOutside : small garden to visit.\\r\\nInside : downstairs, three climate zones enabling us to grow our own fresh herbs and mushrooms.\\r\\nEntrance : shop our own blends and incenses, teapots, containers and knick-knacks for those in need of a nice gift.\\r\\nTop floor : tea salon and gaming lounge. Try our own freshly brewed herbal infusions, our incenses and melanges.\\r\\n',['N']='Maison d\\'Haltevoie',['O']=19631,},[34]={['C']=1.500000,['D']='The living quarters and vivaria of a naturalist who loves to observe the creatures he\\'s caring for.  Watch out, some residents have found their way out of their dedicated habitat.',['N']='Maison de la Gloire d\\'Hallin',['O']=19625,},},['Version']=1773,}"
