R["oh__@palosanto21"]="{['eu']={[30]={['O']=19560,['C']=1.026000,['D']='Have a strall or drink some wine inside, close to a warm fire and sing a bard\\'s tale with your friends.\\nGood old Skyrim wibe ',['N']='Riften House',},[38]={['O']=19286,['C']=1.023000,['D']='As you wander through the skelleton forest (minions of the Vampire lord ) you will get at the entrance of the Mountain of horrors. Walk inside at your own peril ,the Balrog and the Vampire lord are waiting for you ,but also the ghost ship ,which surprisingly might be your ally against the foul horrors from inside the mountain ',['N']='Daenia Dolmen Manor',},[70]={['O']=19259,['C']=1.020000,['D']='Insula verde( the green island ) was once a stable piece of land with mountains and hills surrounding the Verdian lands. The Verde lands are inhabited  by the Verdian people, a culture inclined towards magic and science. When the Great Earthquake shocked the whole world , the Verde lands were the most affected by it.\\nEntire mountains and pices of soil started to colapse, and soon all of the Verde lands and its inhabitants would ve perish.Vedian mages used their magic to prevent this from happeni',['N']='Rimmen Temple',},[15]={['O']=19259,['C']=1.020000,['D']='After many ears of wars and destruction ,the dark forces that corrupted all of Grathwood encountered the last force worty to be reckoned with.The 3 Leaves tribes shamans summoned an ancient spirit using from the remains of the first and the last Silvenar which could bend the nature to it\\'s will. Thus was created a gargantuan entity called Ent or Treant Protector. After many attempts to put it down, the evil forces were destroyed and Grathwood was at peace once again.',['N']='Cormount House',},},['TS']=1690029413,['Version']=1773,['Key']='oh__@palosanto21',}"
