R["oh__@sebille_sangrael"]="{['Key']='oh__@sebille_sangrael',['na']={[9]={['N']='Hangover LSR Two',['O']=19483,['D']='The Final Party of L.S.R.  Rich frat bois from Lamdha Sigma Rho, College of Sapiarchs have gone missing. The entire fraternity is AWOL! It\\'s your job to clean up this mess for the college and find the missing students!',['C']=1.038000,},[82]={['D']='Dare to be your worst self!  Libratorium.Nox a division of Ordo Questor Antigua gives you that freedom! Rent your own personal retreat for as long as you like. A weekend or several Eternities. Hold Infinity in the palm of your hand. Rent Libratorium Nox today!\\r',['O']=19502,['N']='Libratorium Nox',['C']=1.020000,},[26]={['N']='Murder Most Fowl',['O']=19280,['D']='Grand Inquisitrix Livia Meserole\\'s made many enemies during her lengthy careerin the Imperial City. It was only a matter of time before the chickens came home to roost. The constablulary had great difficulty sorting through the evidence in order to determine the culprit. Perhaps you will have better luck recruit!',['C']=1.023000,},[45]={['N']='Anghora VVatt',['O']=19219,['D']='The recent discovery and restoration of Anghora VVatt has tilted the Archaeological Community on it\\'s head. \"Obviously a temple complex from the mid 15th Century BTE. It appears to have been contructed by the Khajitti and added to by Nords 300 years later.\" stated Professor Mrrrra Felix of the Aldmeri Archaelogical Academy.  \\n\"Mature Banyans that seem to have a stranglehold on the complex. Recent renovations by a Breton Wizard have added more defense and livability.',['C']=1.037000,},[49]={['N']='Dark Mage Tower',['O']=19399,['D']='The Dark Tower Riseth over Hag Fen!\\n\"Madame Ricka, why have you come to ze Hagfen?\"\\n\"I came here for the views.\"\\nBut there are no views in ze Hagfen!\"\\n\"I was Misinformed!\" ',['C']=1.017000,},[71]={['N']='Dibella Arboretum',['O']=19483,['D']='Looming over the Northern Elsweyr savannah, sorcery and mystery pervade a work