]=2300,['SizeZ']=2300,['Groups']=0,['SizeX']=500,['Contrast']=1.250000,['Pitch']=0,['Yaw']=3.911283,['Color']=74,['Z']=122399,},[22]={['Id']=4812,['EffectType']=1,['Roll']=0,['Y']=61628,['X']=110454,['Alpha']=1,['SizeY']=2300,['SizeZ']=2300,['Groups']=0,['SizeX']=500,['Contrast']=1.250000,['Pitch']=0,['Yaw']=3.911283,['Color']=74,['Z']=124548,},[23]={['Id']=4813,['EffectType']=1,['Roll']=0,['Y']=61628,['X']=109842,['Alpha']=1,['SizeY']=2300,['SizeZ']=2300,['Groups']=0,['SizeX']=500,['Contrast']=1.250000,['Pitch']=0,['Yaw']=3.911283,['Color']=74,['Z']=125119,},[24]={['MetaData']={['title']='My Little Pink Book',['message']='If someone were to call a Tzimisce inhuman and sadistic, the Tzimisce would probably commend them for their perspicacity, and then demonstrate that their mortal definition of sadism was laughably inadequate. The Tzimisce have left the human condition behind gladly, and now focus on transcending the limitations of the vampiric state. At a casual glance or a brief conversation, a Tzimisce appears to be one of the more pleasant vampires. They seem polite, intelligent, and inquisitive, however, upon closer inspection, it becomes clear that this is merely a mask hiding something alien and monstrous.\\n\\nTzimisce culture, philosophy, and self-image are intimately tied with their practice of Vicissitude. Tzimisce almost invariably modify their own appearance using Vicissitude, sometimes on a nightly basis.\\n\\nGiant sculptures of living flesh, tables made from ghouled children, lovers glued together and transformed into dogs, all of these are tools for a sufficiently insightful Tzimisce. The most infamous of these creations, the szlachta and vozhd, are used as bodyguards and tanks.\\n\\nTzimisce culture revolves around ways and means of hurting other beings. Vicissitude allows the torturer to become his own toolkit, reforming his extremities (or the victim\\'s extremities) into a variety of intrusive implements, perfectly shaped to fit the victim (or, 