R["oh__@drewcifer665"]="{['Version']=1769,['Key']='oh__@drewcifer665',['TS']=1658367096,['na']={[33]={['D']='My first Halloween house, each year it told the tale of a vampire losing touch with their humanity and surrendering to the monster within.  At this point, the monster reigns.  ',['C']=1.023000,['N']='Nightmare',['O']=18914,},[36]={['D']='',['C']=1.013000,['N']='Party Palace',['O']=18890,},[79]={['D']='the Throne of Darkness, vampire themed with a splash of mad scientist.  The throne room itself is intentionally minimal.  It\\'s all about the throne.',['C']=1.048000,['N']='Vampire Castle',['O']=18880,},[62]={['O']=18270,['N']='The Sacred Machine',},[56]={['O']=18270,['N']='Sanctuary of Darknes',},[72]={['D']='my 2nd Halloween house.  Mad Scientist\\'s lair.  ',['C']=1.023000,['N']='SkullcrusherMountain',['O']=18913,},[89]={['D']='',['C']=1.017000,['N']='Blackwood Chapel',['O']=18890,},[74]={['D']='I totally forgot to add this one.  The idea here was a wedding/banquet hall.  The reason why quite a bit of it isn\\'t furnished is so that the client can get the right plateware and special event decorations but the hall is filled enough to see how many people it can hold.  Various places in the back for outdoor weddings in a variety of faiths.',['C']=1.013000,['N']='Pellitine Manor',['O']=19020,},[43]={['O']=18270,['N']='looking glass manor',},[76]={['D']='Hard to catagorize this house because I used two very different decorating styles on either side of the street.  ',['C']=1.051000,['N']='Bangkorai Oasis',['O']=18951,},[46]={['O']=18270,['N']='Ironfist Grand Manor',},[94]={['D']='Under the sea botany lab for the study of differing environments on the flora of Tamriel.  ',['C']=1.012000,['N']='Coral Atoll',['O']=19194,},[63]={['D']='Cheery and happy, not all my homes are dark places of murder and mayhem.',['C']=1.022000,['N']='New Life Snow Globe',['O']=18963,},},}"
