R["oh__@asgemar"]="{['na']={[40]={['D']='After a hard-won battle against a pirates, Rylaenvol and his friends Jaxi, Quinn and Seldan limped to the Topal Bay Island, claiming the former hideout of the pirates for their own. The four lived comfortably on the island while repairing their ship, and treated the months there as a much needed vacation. However, once the ship was repairs, duty called and the four were away again. Though the climate was agreeable to Ryl, he found himself not visiting the island often due to it\\'s isolation.',['C']=1.031000,['O']=19062,['N']='Topal Bay Island',},[82]={['D']='Rylaenvol\\'s mystic realm, a space existing between spaces that is safe for those he brings in. This is where Ryl retreats to for peace and quiet, as well as to enjoy time relaxing and working on crafts.',['C']=1.020000,['O']=19057,['N']='Mage\\'s Pocket Realm',},[62]={['D']='After helping the Psijic order, Rylaenvol was awarded the Grand Villa as a place to stay where he may go to rest and to study. The beauty and serenity of the displaced isle is a comfort to Ryl after long journies across Tamriel, though it\\'s isolation causes him to long for his friends, and so he tends to not stay for long.',['C']=1.021000,['O']=19114,['N']='Artaeum Manor',},},['Version']=1767,['TS']=1651530726,['Key']='oh__@asgemar',}"
