R["fx__na__@lenabear2__47"]="{['TS']=1641767054,['Version']=1767,['Effects']={[1]={['Alpha']=0,['Y']=37100,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=85020,['Id']=1006,['X']=83212,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='People say you shouldn\\'t go looking for love because it will find you when you least expect it.\\nAnd now we find a girl lost in her mundane life, hoping her love will show up soon.\\n\\n',['name']='A voice',},['Yaw']=3.141593,['Contrast']=1,},[2]={['Alpha']=0,['Y']=37707,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=88550,['Id']=1007,['X']=85830,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='Why does her heart pound so hard every time she talks to him?\\nHe gives her butterflies, and nervous excitement emanates from within her core.\\nWhy does the sun shine brighter these days?\\nCould he be the one??\\n',['name']=' A voice',},['Yaw']=4.712389,['Contrast']=1,},[3]={['Alpha']=0,['Y']=38048,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=88605,['Id']=1008,['X']=87518,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='Their hearts beat together as one.\\nAll feels so right and natural, as if they had known each other their whole lives.\\nHer voice is music to his ears, and his embrace is her haven.\\nA feeling is created that no amount of wealth could ever replace.',['name']=' A voice',},['Yaw']=4.712389,['Contrast']=1,},[4]={['Alpha']=0,['Y']=38186,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=91243,['Id']=1009,['X']=86976,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='The threshold is crossed as they bind their hearts together.\\nThey are each other\\'s first thought in the morning and last thought at night.\\nHe inspires her to be a better person, and she makes his world a happier place.\\nA bond is formed that will withstand the test of time and physical boundaries.',['name']=' A voice',},['Yaw']=1.570796,['Contrast']=1,},[5]={['Alpha']=0,['Y']=38413,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=91588,['Id']=1010,['X']=84400,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='There are billions of people on this planet, yet they stumbled upon each other.\\nThere are countless stars in the galaxy, but their love outshines the brightest of them.\\nIn her gaze, he is on top of the world; in his arms, she is walking on clouds.',['name']=' A voice',},['Yaw']=1.570796,['Contrast']=1,},[6]={['Alpha']=0,['Y']=38749,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=90362.394692,['Id']=1011,['X']=81838.257914,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='They could have been the perfect couple that attracted envy.\\nHowever, as deep as their love is, the obstacles they face are equally insurmountable.\\n\\nIn this lifetime, their union is impossible. \\nGone are the dreams of living a life of bliss.',['name']=' A voice',},['Yaw']=0,['Contrast']=1,},[7]={['Alpha']=0,['Y']=38695,['SizeY']=235,['Pitch']=0,['Groups']=0,['SizeZ']=235,['Color']=197999,['Roll']=0,['Z']=89358,['Id']=1012,['X']=80361,['EffectType']=594,['SizeX']=90,['MetaData']={['message']='Sometimes in life, you have to be brave and be willing to let go.\\nThey embrace one last time before stepping forward onto separate paths.\\n\\nOne day, they will be reunited, solidified in their love.\\nFrozen through time and space. Together. For eternity.\\nEven the strongest storms will be unable to break them apart.\\n\\nWhen colors fade and water runs dry, they will still always have each other.',['name']=' A voice',},['Yaw']=1.570796,['Contrast']=1,},},}"
