R["fx__eu__@noaptwen__37"]="{['TS']=1640964162,['Effects']={[1]={['X']=0,['Pitch']=0,['Color']=494949,['Z']=0,['Yaw']=0,['Y']=0,['Roll']=0,['SizeZ']=100,['EffectType']=614,['Alpha']=1,['SizeY']=100,['Groups']=0,['Contrast']=1,['Id']=1004,['SizeX']=120,},[2]={['Z']=23819,['Groups']=0,['Pitch']=4.792674,['SizeX']=26.456456,['Color']=102439,['Yaw']=6.197664,['MetaData']={['title']='Avertissement',['message']='Rest\\n       ez     G \\n                  r\\n                    ou\\n                        p\\n                          ez__\\n                                  \\\\\\n                                    \\\\',},['Id']=1005,['SizeZ']=30,['EffectType']=8503,['Alpha']=1,['SizeY']=30,['Roll']=6.106907,['Contrast']=0.800000,['X']=31466,['Y']=21137,},[3]={['Z']=25712,['Groups']=0,['Pitch']=4.712564,['SizeX']=26.456456,['Color']=352208,['Yaw']=0.558505,['MetaData']={['title']='Livre étrange',['message']='\\n\\n\\nUne danse ne vous sauvera pas\\n\\nEncore moins du courage en bouteille\\n\\nMais peut être trouverez vous un certain réconfort en le faisant\\n\\nAvant de sombrer dans les ténèbres...',},['Id']=1006,['SizeZ']=30,['EffectType']=8503,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=1,['X']=37401,['Y']=21982,},[4]={['X']=37394,['Pitch']=0.436332,['Color']=30301,['Z']=24541,['Yaw']=6.108652,['Y']=21573,['Roll']=0,['SizeZ']=260,['EffectType']=880,['Alpha']=1,['SizeY']=260,['Groups']=0,['Contrast']=0.370000,['Id']=1007,['SizeX']=300,},[5]={['Z']=19456,['Groups']=0,['Pitch']=0.261799,['SizeX']=38.456456,['Color']=242423,['Yaw']=1.570796,['MetaData']={['title']='Guide de poche de l\\'Empire, Première édition/Elsweyr',['message']='Par la Société Géographique Impériale, 2E 864  \\n\\nLe Khajiit croit que leurs dieux accordent réguli��rement des bénédictions à son peuple élu, sous la forme du sucre de lune, une substance originaire de la forêt de Tenmar dans le sud d\\'Elsweyr. \\nCe sucre a une grande variété d\\'utilisations, il est tour à tour un assaisonnement et un ingrédient magique, un moyen de communion avec les saintes lunes et une drogue dangereuse et addictive. \\nLe Khajiit l\\'interprète comme le \"clair de lune cristallisé\", pris dans l\\'eau de la mer de Topal et amené aux plantations de canne à sucre de la Tenmar par la force des marées jumelles. \\n\\n                                     MD\\n\\nEn prenant le sucre, le Khajiit estime qu\\'il consomme de petites portions de l\\'��me des dieux éternels. Ce qui les pousse dans des accès d\\'extase et d\\'abandon, et les rues des grandes villes d\\'Elsweyr sont pleines d\\'hommes-chats tremblants en proie à des crises de sucre.\\n                                     ',},['Id']=1008,['SizeZ']=43,['EffectType']=8501,['Alpha']=1,['SizeY']=43,['Roll']=0,['Contrast']=0.680000,['X']=31287,['Y']=21456,},[6]={['Z']=17867,['Groups']=0,['Pitch']=4.757768,['SizeX']=32.456456,['Color']=997279,['Yaw']=3.162537,['MetaData']={['title']='Les Khajiits et le ja-Kha\\'jay',['message']='\\nTome I\\n\\nLes Khajiits sont liés au Treillis Lunaire, le Ja\\'Kha\\'jay. Les phases de Masser et de Secunda lors naissance déterminent la forme que le Khajiit prendra dans la vie. Les nouveaux-n��s Khajiits se ressemblent tous beaucoup, leur forme ne devient évidente qu\\'après plusieurs semaines et sont les 17 suivantes:\\n\\n[1] Ohmes\\n[Masser : Nouvelle] [Seconda : Pleine]\\n\\nLes Ohmes ont une apparence humanoïde, au niveau du visage notamment, très similaire à celle des Bosmers. Pour éviter les méprises, de nombreux Ohmes se tatouent ou se peignent le visage pour rappeler des traits félins.\\n\\n\\n[2] Ohmes-raht\\n[Masser : Nouvelle] [Seconda : Croissante]\\n\\nLes Ohmes-raht sont bipèdes et peuvent facilement être confondus avec des elfes ou des hommes. Cependant, contrairement à ces derniers, le corps d\\'un Ohme-raht est recouvert d\\'une légère fourrure et ils sont dotés d\\'une queue. Ils se peignent souvent le visage comme le font les Ohmes.\\n\\n\\n[3] Cathay\\n[Masser : Nouvelle] [Seconda : Nouvelle]\\n\\nLes Cathays sont similaires aux Suthay-raht, sinon légèrement plus gros et plus forts, avec la différence majeure que leurs pattes sont plantigrades.\\n\\n\\n[4] Cathay-raht \\n[Masser : Croissante] [Seconda : Croissante]\\n\\nLes Cathays-raht ont été surnommés \"hommes-jaguar\" par la Société géographique impériale du fait de l\\'aspect des spécimens observés. On dit aussi qu\\'ils sont plus agiles qu\\'un loup-garou, bien que nul n\\'aie jamais eu les moyens de vérifier cette affirmation. Une caractéristique plus évidente à vérifier est la présence d\\'une barbe phallique plus fournie que chez les Suthays.\\n\\n',},['Id']=1009,['SizeZ']=41,['EffectType']=8501,['Alpha']=1,['SizeY']=41,['Roll']=3.146829,['Contrast']=0.620000,['X']=29286,['Y']=21509,},[7]={['Z']=19871,['Groups']=0,['Pitch']=4.756022,['SizeX']=38.456456,['Color']=41524,['Yaw']=0,['MetaData']={['title']='L\\'histoire de Dro\\'Zira',['message']='En entendant le puissant rugissement d\\'Alkosh, le Grand roi félin du Temps , les anciens Khajiits se levèrent pour répondre à l\\'appel. En trois jours, ils traversèrent Tamriel d\\'un bout à l\\'autre, sans même s\\'arrêter pour prendre le sucrelune, car telle était la rapidité des Khajiits d\\'antan.\\n\\nIls rejoignirent la troupe d\\'Alkosh et devinrent ses plus puissants guerriers. Envieux du dévouement dont ils faisaient preuve envers leur maître, Lorkhaj décida de les punir en accordant son rugissement à Ra\\'Wulfharth.\\nMais en voyant la férocité des guerriers khajiits, Ra\\'Wulfharth ne put se résoudre à les mettre à mort. à l\\'aide du rugissement qui lui avait été donné par Lorkhaj, il s\\'adressa à Masser et Secunda, leur demandant d\\'atteindre leur plénitude dans le ciel. Les guerriers khajiits devinrent Senche, mais Lorkhaj les priva de raison.\\n\\nLorsque Ra\\'Wulfharth revint plonger ses crocs dans le Mont écarlate, il appela son peuple à l\\'aide. Dro\\'Zira fut le seul à répondre à l\\'appel, car de tous les \"Rhojiits\", il était le seul à se souvenir.\\n\\nMais ces bardes nordiques ne chantent jamais les exploits du grand Roi de cendre, qui gravit le Mont écarlate lui-même sur le dos de Dro\\'Zira pour frapper les Dunmers en plein coeur. Jamais ils ne mentionnent la bravoure de Dro\\'Zira, qui bondit sur Dumalacath, l\\'Orque-Nain, lorsqu\\'il pressait sa lame sur la gorge du Roi de cendre pour l\\'empêcher de parler.\\nIls ne disent pas non plus que Lorkhaj libéra Dro\\'Zira du royaume de Sheggorath pour son courage et pour avoir sauvé le Roi de cendre ! Alors si tu rencontres un barde médisant des Khajiits, assure-toi de lui laisser un douloureux souvenir de tes griffes pour qu\\'il n\\'oublie plus jamais qui a sauvé Bordeciel. ',},['Id']=1010,['SizeZ']=46,['EffectType']=8503,['Alpha']=1,['SizeY']=46,['Roll']=0,['Contrast']=1.310000,['X']=29934,['Y']=21326,},[8]={['X']=29811,['Pitch']=1.581268,['Color']=352723,['Z']=19588,['Yaw']=0.094248,['Y']=21218,['Roll']=0,['SizeZ']=27,['EffectType']=880,['Alpha']=1,['SizeY']=27,['Groups']=0,['Contrast']=1.140000,['Id']=1011,['SizeX']=26,},[9]={['X']=29679,['Pitch']=1.565560,['Color']=352723,['Z']=17524,['Yaw']=2.907719,['Y']=21425,['Roll']=2.726204,['SizeZ']=27,['EffectType']=880,['Alpha']=1,['SizeY']=27,['Groups']=0,['Contrast']=1.140000,['Id']=1012,['SizeX']=26,},[10]={['X']=28860,['Pitch']=1.556834,['Color']=352723,['Z']=19333,['Yaw']=3.056072,['Y']=21330,['Roll']=2.874557,['SizeZ']=27,['EffectType']=880,['Alpha']=1,['SizeY']=27,['Groups']=0,['Contrast']=1.140000,['Id']=1013,['SizeX']=26,},[11]={['X']=30241,['Pitch']=1.562070,['Color']=145974,['Z']=19951,['Yaw']=3.255039,['Y']=21262,['Roll']=3.160791,['SizeZ']=44,['EffectType']=880,['Alpha']=1,['SizeY']=44,['Groups']=0,['Contrast']=0.510000,['Id']=1014,['SizeX']=42,},[12]={['X']=28190,['Pitch']=1.548107,['Color']=125063,['Z']=20059,['Yaw']=3.183481,['Y']=21398,['Roll']=3.089233,['SizeZ']=45,['EffectType']=880,['Alpha']=1,['SizeY']=45,['Groups']=0,['Contrast']=0.510000,['Id']=1015,['SizeX']=44,},[13]={['Z']=23378,['Groups']=0,['Pitch']=4.712564,['SizeX']=26.456456,['Color']=291711,['Yaw']=0.966912,['MetaData']={['title']='Dernière lettre',['message']='Je ne sortirai jamais de ce maudit endroit ; je le réalise à présent en écrivant cette dernière lettre. Saleté de crocodile!\\nMa jambe est trop endommagée et mes compagnons tardent à revenir. \\n\\nIls sont partis explorer le passage que nous avons découvert... il y a quelques heures... \\n\\nLe portail est bloqué et c\\'était la seule pièce restante. Il y a forcément quelques chose dedans qui nous aidera!\\n\\nMa jambe me faisait trop soufrir pour les accompagner mais j\\'ai rampé voila une heure pour essayer de les retrouver et... le passage est de nouveau clos. Je n\\'ai plus la force de bouger depuis.\\n\\nJ\\'espère qu\\'ils reviendront avec les indices qu\\'ils nous manquent pour dévérouiller ce maudit portail. \\nJ\\'en suis persuadé, la clé est dans les cristaux.\\nMais depuis qu\\'ils se sont engagés dans cette nouvelle salle je n\\'entends plus rien... je ne sens plus rien non plus... j\\'ai froid... \\n\\nQu\\'Arkay me protège et me guide dans la mort.\\n\\nMathias Madier',},['Id']=1016,['SizeZ']=30,['EffectType']=8501,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=0.750000,['X']=36584,['Y']=21818,},[14]={['X']=29823,['Pitch']=0,['Color']=999761,['Z']=21991,['Yaw']=0,['Y']=20944,['Roll']=0,['SizeZ']=2020,['EffectType']=431,['Alpha']=1,['SizeY']=2020,['Groups']=0,['Contrast']=1.160000,['Id']=1017,['SizeX']=1880,},[15]={['Z']=24881,['Groups']=0,['Pitch']=0,['SizeX']=26.456456,['Color']=356298,['Yaw']=5.585054,['MetaData']={['title']='Introduction',['message']='Bienvenue à tous.\\n\\nPour profiter un maximum de ce donjon quelques consignes à respecter:\\n\\n- Lisez les livres et suivez leurs conseils (celui à quelques mètres est important par exemple). \\nAttendez vos compagnons avant d\\'interragir avec un objet ou de résoudre une énigme (vous pouvez lire les livres sans danger). \\n\\n-Si vous voyez qu\\'en intéragissant avec un item rien ne se passe, merci de le laisser dans l\\'état où vous l\\'avez trouvé ; certaines actions débloqueront peut être plus tard ces items...\\n\\n-Vous pouvez pour débloquer une pièce intéragir avec un objet de tout type, donner une réponse dans le /say ou /zone, faire une émote (l\\'ensemble du groupe doit la faire), utiliser un memento, se tenir à un endroit précis... et n\\'oubliez pas les chats savent grimper!\\n-Dans le cas où vous auriez un.. accident malencontreux, ne revenez pas à l\\'entrée mais faites un: /me vient de mourrir. Vous serez alors \"débloqués\" par les mystérieuses forces de ce donjon, pour poursuivre l\\'aventure en fantôme.\\n\\n-Dernière consigne: si vous avez besoin d\\'indice suplémentaire vous pouvez  faire appel aux âmes érrantes de ce lieu qui vous aideront.. peut-être. Tapez /me commence à paniquer car il n\\'a plus de.. (nourriture, temps, alcool,.. à vous de choisir) et vous aurez de l\\'aide.\\n\\nPS: merci d\\'ignorez le Ja\\'khajiit qui vous espionne dans les recoins. Ce chat est furieux de votre intrusion dans son donjon car il garde jalousement ses secrets et son trésor.\\n\\nBonne aventure!!',},['Id']=1018,['SizeZ']=30,['EffectType']=8503,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=1.250000,['X']=30714,['Y']=21377,},[16]={['X']=37515,['Pitch']=0,['Color']=494947,['Z']=26090,['Yaw']=4.872959,['Y']=21891,['Roll']=0,['SizeZ']=1000,['EffectType']=19,['Alpha']=0.500000,['SizeY']=1000,['Groups']=0,['Contrast']=1,['Id']=1019,['SizeX']=980,},[17]={['X']=37107,['Pitch']=0,['Color']=494947,['Z']=26674,['Yaw']=3.326598,['Y']=21903,['Roll']=0,['SizeZ']=1000,['EffectType']=19,['Alpha']=0.500000,['SizeY']=1000,['Groups']=0,['Contrast']=1,['Id']=1020,['SizeX']=1260,},[18]={['X']=36947,['Pitch']=1.570971,['Color']=494947,['Z']=26100,['Yaw']=4.712389,['Y']=21873,['Roll']=0,['SizeZ']=1160,['EffectType']=18,['Alpha']=0.500000,['SizeY']=1160,['Groups']=0,['Contrast']=1,['Id']=1021,['SizeX']=1520,},[19]={['X']=35979,['Pitch']=0,['Color']=494947,['Z']=26719,['Yaw']=2.530727,['Y']=21930,['Roll']=0,['SizeZ']=1040,['EffectType']=19,['Alpha']=0.500000,['SizeY']=1040,['Groups']=0,['Contrast']=1,['Id']=1022,['SizeX']=1000,},[20]={['X']=35944,['Pitch']=0,['Color']=494947,['Z']=26578,['Yaw']=2.792527,['Y']=21915,['Roll']=0,['SizeZ']=1000,['EffectType']=19,['Alpha']=0.500000,['SizeY']=1000,['Groups']=0,['Contrast']=1,['Id']=1023,['SizeX']=1020,},[21]={['X']=35873,['Pitch']=0,['Color']=494947,['Z']=25728,['Yaw']=0.959931,['Y']=21663,['Roll']=0,['SizeZ']=840,['EffectType']=19,['Alpha']=0.500000,['SizeY']=840,['Groups']=0,['Contrast']=1,['Id']=1024,['SizeX']=1480,},[22]={['X']=37790,['Pitch']=0,['Color']=494947,['Z']=24374,['Yaw']=5.148721,['Y']=21968,['Roll']=0,['SizeZ']=1000,['EffectType']=19,['Alpha']=0.500000,['SizeY']=1000,['Groups']=0,['Contrast']=1,['Id']=1025,['SizeX']=1000,},[23]={['X']=41627,['Pitch']=1.570971,['Color']=999987,['Z']=24151,['Yaw']=3.403392,['Y']=21817,['Roll']=0,['SizeZ']=2340,['EffectType']=910,['Alpha']=1,['SizeY']=2340,['Groups']=0,['Contrast']=1,['Id']=1026,['SizeX']=4120,},[24]={['Z']=20857,['Groups']=0,['Pitch']=4.799655,['SizeX']=26.456456,['Color']=102439,['Yaw']=3.152065,['MetaData']={['title']='Journal d\\'expedition',['message']='....\\nLes pièges ont eu raison de mes compagnons... mais ce trésor! Le paradis d\\'un jeune khajiit!\\n\\nJ\\'dazo ne peut pas en croire ses moustaches. \\nUn champ de canne à sucre caché dans les profondeurs de ce temple abandonné. \\n\\nDu sucre-lune offert à ce khajiit comme récompense apr��s tous ces efforts.\\nJ\\'dazo doit vite trouver la sortie pour récupérer de quoi récolter ces cannes.  \\n\\n\\nCe khajiit a fait le tour mais ne trouve pas la sortie de ce maudit temple! \\nPas d\\'indice comme dans les précédents salles... si seulement ces compagnons étaient encore là pour l\\'aider... Il faut sans doute un mot de passe mais J\\'dazo ne le trouve pas. \\n\\nQuelle ironie pour un khajiit de mourir au milieu de sucre-lune...',},['Id']=1027,['SizeZ']=30,['EffectType']=8501,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=1,['X']=35896,['Y']=21311,},[25]={['Z']=19864,['Groups']=0,['Pitch']=4.799655,['SizeX']=37.456456,['Color']=80319,['Yaw']=3.839724,['MetaData']={['title']='Les Khajiits et le ja-Kha\\'jay',['message']='\\nTome III\\n\\n[9] Senche\\n[Masser : Pleine] [Seconda : Pleine] \\n\\nLes des Senches seraient similaires aux Pahmar-raht en terme de taille. Quadrupèdes, ils sont néanmoins très grands, à peu près aussi haut qu\\'un Altmer une fois debout, ou ayant la hauteur d\\'épaule d\\'un cheval. \\nCertains disent que leur poids est comparable à celui de vingt Altmer, ce qui peut être un peu exagéré. Leurs membres antérieurs sont épais et leurs membres arrières une fois et demi plus longs, ce qui leur donne une apparence de singe. Ils ont une fourrure fauve, rubanée de rayures de la couleur du sang sec. \\nLes Khajiits bipèdes peuvent parfois les utiliser comme coursiers ou montures, si le Senche le permet.\\nLes Senches sont souvent confondus avec leurs cousins proches, les Senches-Chat, dont la forme est plus proche encore du tigre. Ce sont d\\'ailleurs souvent les Khajiits eux-mêmes qui se content de les appeler \"Senches\".\\n\\n[10] Senche-raht\\n[Masser : Pleine] [Seconda : Croissante]\\n\\nSurnommés \"tigre de bataille\", les Senches-raht sont plus gros et plus lents que les Senches. Ils poss��dent une envergure plus courte et des jambes plus droites. Le Senche-raht moyen peut atteindre deux Altmer et peut peser autant ou plus de cinquante. Il s\\'agit néanmoins, de la plus grande de toutes les formes qu\\'un Khajiit puisse adopter.\\nLes senches-rahts sont des êtres intelligents dotés d\\'une grande mémoire, capables de parler et capables de lancer des sorts. \\nBien que comme les Senche, ils puissent fonctionner comme des montures et des bêtes de somme et de guerre, ils n\\'aiment pas être abaissés à un statut bestial.',},['Id']=1028,['SizeZ']=43,['EffectType']=8501,['Alpha']=1,['SizeY']=43,['Roll']=0,['Contrast']=0.750000,['X']=29035,['Y']=21281,},[26]={['Z']=19803,['Groups']=0,['Pitch']=0.123918,['SizeX']=41.456456,['Color']=191310,['Yaw']=2.350959,['MetaData']={['title']='Les Khajiits et le ja-Kha\\'jay',['message']=' \\nTome IV\\n\\n\\n[11] Pahmar\\n[Masser : Pleine] [Seconda : Nouvelle]\\n\\nLes Pahmar sont une forme bipède géante qui ressemble à leurs plus gros homologues, les Pahmar-raht, ainsi qu\\'aux Senche.\\n\\n\\n[12] Pahmar-raht\\n[Masser : Pleine] [Seconda : Décroissante]\\n\\nLes Pahmar-raht sont une forme bipède géante. Du fait qu\\'ils sont les plus solides des Khajiits, ils sont généralement déployés en tant que gardes du corps et guerriers. Comme la forme Pahmar, ils ressemblent aux Tigres-Senche, mais les Pahmar-raht diffèrent, d\\'abord, en ce qu\\'ils sont bipèdes, mais aussi plus grands et plus dangereux.\\n\\n\\n[13] Alfiq\\n[Masser : Décroissante] [Seconda : Pleine]\\n\\nLes Alfiqs sont une forme de Khajiit douée pour la magie partageant la forme de chats tout à fait communs. Bien que les étrangers pensent généralement que les Alfiqs sont muets, ce n\\'est qu\\'une rumeur infondée. Pour autant, cette ignorance leur permet parfois de tromper les étranger et de récolter des informations sans attirer l\\'attention.\\n\\n\\n[14] Alfiq-raht\\n[Masser : Décroissante] [Seconda : Croissante]\\n\\nOn ne sait rien des Alfiq-raht, sinon qu\\'ils sont probablement plus gros que les Alfiq.',},['Id']=1029,['SizeZ']=46,['EffectType']=8501,['Alpha']=1,['SizeY']=46,['Roll']=6.223844,['Contrast']=1,['X']=30000,['Y']=21625,},[27]={['Z']=19874,['Groups']=0,['Pitch']=4.799655,['SizeX']=33.456456,['Color']=202414,['Yaw']=5.759587,['MetaData']={['title']='Le sentier et la marée',['message']='Tous les chats peuvent voir les Lunes, sentir la caresse de leur douce lumière sur leur fourrure. Tous les chats peuvent sentir le flux de la marée, le rythme de la danse des deux Lunes ne peut être ignoré.\\n\\nMais tous n\\'ont pas la chance de pouvoir entendre les mots « Jone » et « Jode » murmurés à leurs oreilles tandis qu\\'ils rôdent dans les landes célestes entre le bon Nirni et la Noirceur par-delà le Monde, les protégeant des hurlements du vide. C\\'est pour cette raison que l\\'épiscope lunaire mène les chatons sur le chemin de la connaissance des Mouvements et des Marées.\\n\\nUn vrai félin cherche sans relâche le Vrai Sentier, essayant un après l\\'autre les chemins tracés par les danses de Jone et Jode dans le ciel, faisant fi de leurs coussinets meurtris et leurs gorges asséchées. Ils ont usé plus de pistes qu\\'il y a de grains de sucre dans le monde entier, et il est aisé pour un chat de se laisser aller à l\\'ennui et abandonner la chasse. C\\'est pourquoi l\\'épiscope lunaire inspire les chatons, partageant avec eux les histoires d\\'un autre temps, les poussant gentiment à reprendre la traque.\\n\\nTous les chats songent aux Sables par-delà les Étoiles, où les dunes sont faites de sucre. Tous les chats rêvent du Refrain au Clair de Lune, un son joyeux si cher aux véritables félins.\\n\\nMais tous les chats ne connaitront pas la douce étreinte de Khenarthi à la fin de leur journée, et toutes les âmes ne voleront pas au-delà de la chaleur infinie. C\\'est pour cela que l\\'épiscope lunaire se doit de corriger les vilains félins, frappant ceux qui s\\'éloignent des chemins qu\\'ont tissé les Lunes. ',},['Id']=1030,['SizeZ']=38,['EffectType']=8501,['Alpha']=1,['SizeY']=38,['Roll']=0,['Contrast']=0.620000,['X']=32094,['Y']=21452,},[28]={['Z']=19739,['Groups']=0,['Pitch']=0.349066,['SizeX']=44.456456,['Color']=51335,['Yaw']=3.228859,['MetaData']={['title']='Les Khajiits et le ja-Kha\\'jay',['message']='\\nTome II\\n\\n[5] Tojay\\n[Masser : Croissante] [Seconda : Nouvelle]\\n\\nOn sait peu de choses sur les Tojay, hormis qu\\'ils vivent dans les marais du sud et les jungles d\\'Elsweyr, ainsi que dans la forêt de Tenmar.\\n\\n\\n[6] Tojay-raht\\n[Masser : Croissante] [Seconda : Décroissante]\\n\\nOn sait peu de choses sur les Tojay-raht, sauf qu\\'ils sont bipèdes et ont des pattes digitigrades.\\n\\n\\n[7] Suthay-raht\\n[Masser : Nouvelle] [Seconda : Décroissante]\\n\\nLes Suthay-raht sont parfois surnommés \"ja\\'khajiit\". Disposant d\\'une queue, les Suthay-raht ont une taille et une construction similaires à celles des races humaines, bien qu\\'entièrement recouverts de fourrure. Leurs doigts se terminent par des griffes, et leur tête est similaire à celle d\\'un chat. Ils ont également de légères barbes phalliques et sont capables de siffler et de ronronner tel des chats.\\n\\nLes Suthay-raht sont connus pour être agiles et acrobates, mais aussi sournois et audacieux. Cela en fait de bons aventuriers, commerçants et, malgré eux, de bons esclaves. Ils ne sont en revanche pas aussi bons guerriers que les Cathay-raht. \\n\\n\\n[8] Suthay\\n[Masser : Nouvelle] [Seconda : Nouvelle]\\n\\nSimilaires en tous points aux Suthays-raht, bien que de moindre stature.',},['Id']=1031,['SizeZ']=51,['EffectType']=8501,['Alpha']=1,['SizeY']=51,['Roll']=0,['Contrast']=1,['X']=28219,['Y']=21776,},[29]={['Z']=20501,['Groups']=0,['Pitch']=1.570971,['SizeX']=26.456456,['Color']=41117,['Yaw']=1.570796,['MetaData']={['title']='Les Khajiits et le ja-Kha\\'jay',['message']='\\nTome V\\n\\n[15] Dagi\\n[Masser : Décroissante] [Seconda : Nouvelle]\\n\\nLes dagis sont la forme moins courante de Khajiits. Vivant dans les marais du sud et les régions de la jungle d\\'Elsweyr, ainsi que dans la forêt de Tenmar, ils ont des caractéristiques faciales comparables à celles des lynx et sont de petite taille, ce qui les place parmi les plus petites formes de khajiit. En raison de leur poids léger, ils semblent généralement habiter dans des branches d\\'arbres plus hautes. En raison de cette tendance à grimper aux arbres, ils sont régulièrement comparés aux singes, bien que cela soit considéré comme insultant. Cependant, certains folklores prétendent qu\\'une patte Dagi momifiée peut exaucer des souhaits, reflétant les histoires de pattes de singe chez les Bosmers. Les Dagis sont soupçonnés d\\'être des lanceurs de sorts qualifiés.\\n\\n\\n[16] Dagi-raht\\n[Masser : Décroissante] [Seconda: décroissante]\\n\\nSemblables en tous points aux Dagis, de la forme à l\\'habitat, en passant par l\\'environnement. La spécificité des Dagis-raht ne nous semble pas encore connue, mais ils est probable qu\\'ils soient plus gros que les Dagis. \\n\\n\\n[17] Mane\\n[Masser : Alignée] [Seconda : Alignée]\\n\\nLa Crinière, ou Mane, est le titre du chef spirituel des Khajiits en Elsweyr. Une Crinière ne peut naître que sous un alignement rare de Masser et Secunda quand, selon la légende, une troisième lune apparaît dans le ciel. La tradition Khajiit veut qu\\'une seule Crinière puisse être vivante à un moment donné. Ce faisant, ils croient en une réincarnation de la Crinière dans des corps différents.\\n\\n',},['Id']=1032,['SizeZ']=30,['EffectType']=8501,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=1,['X']=29970,['Y']=21862,},[30]={['Z']=19825,['Groups']=0,['Pitch']=6.209881,['SizeX']=43.456456,['Color']=90937,['Yaw']=5.068436,['MetaData']={['title']='Parole d\\'Ahnissi, mère de clan',['message']='Tome I\\n\\nPropos Tenus par la Mère de Clan Ahnissi à sa Fille Préférée\\n\\n\\nAhnissi a décidé de te parler. Tu n\\'es plus un chaton miaulant et tu as appris à taire les secrets, c\\'est pourquoi Ahnissi s\\'adresse à toi.\\n\\nAu commencement, deux compagnons partageaient la même litière. Ils s\\'appelaient Ahnurr et Fadomaï. Après de nombreuses phases, Fadomaï dit à Ahnurr : \" Marions-nous et engendrons des enfants afin de pouvoir partager notre bonheur avec eux. \"\\n\\nIls donnèrent alors naissance à Alkosh, le Premier félin. Et Ahnurr déclara : \" Alkosh, nous te faisons don du temps, car existe-t-il être plus lent ou plus rapide qu\\'un chat ? \"\\n\\nEt ils donnèrent aussi vie à Khénarthi, le Vent. \" Nous te donnons le ciel, Khénarti, car qui peut voler plus haut que le vent ? \"\\n\\nPuis vint Magrus, l\\'Oeil de Chat. \" Le soleil est tien, Magrus, car qu\\'y a-t-il de plus brillant que l\\'oeil d\\'un félin ? \"\\n\\nEt ensuite Mara, la Petite mère. \" Mara, tu seras l\\'amour, car qui est plus aimant qu\\'une mère ? \"\\n\\nEt enfin, finalement, S\\'rendarr le Nabot. \" S\\'rendarr, nous t\\'offrons la pitié, car comment un nabot pourrait-il survivre sans la pitié des autres ? \"\\n\\nDe nombreuses phases s\\'écoulèrent ; Ahnurr et Fadomaï vivaient heureux.\\n\\nPuis Ahnurr dit : \" Nous devrions avoir d\\'autres enfants pour partager notre bonheur avec eux aussi \" et Fadomaï fut de son avis. Elle donna alors naissance à Hermora, puis Hircine, Merrunz, Mafala, Sanguiyn, Sheggorath et de nombreux autres.\\n\\nEt Fadomaï dit :\\n\\n\" Hermora, tu incarneras les marées, car qui mieux que les lunes peuvent prédire les marées, et inversement ? \"\\n\\n\" Hircine, tu seras le Chat affamé, car qui chasse avec plus de détermination qu\\'un félin dont le ventre est vide ? \"',},['Id']=1033,['SizeZ']=47,['EffectType']=8501,['Alpha']=1,['SizeY']=47,['Roll']=0,['Contrast']=1,['X']=29162,['Y']=21732,},[31]={['Z']=19673,['Groups']=0,['Pitch']=4.712564,['SizeX']=42.456456,['Color']=41119,['Yaw']=4.014257,['MetaData']={['title']='Parole d\\'Ahnissi, mère de clan',['message']='\\nTome II\\n\\n\" Merrunz, tu seras le Ja\\'Khajiit, car qu\\'existe-t-il de plus destructeur qu\\'un jeune chat ? \"\\n\\n\" Mafala, tu seras la m���re du clan, car qu\\'y a-t-il de plus secret que les mystères qu\\'elle garde avec ses consoeurs ? \"\\n\\n\" Sanguiyn, tu incarneras le Sanguinaire, car qui peut contrôler les pulsions du sang ? \"\\n\\n\" Sheggorath, tu seras le Skoume, car qui est plus fou qu\\'un chat drogué au skouma ? \"\\n\\nEt Ahnurr ajouta : \" Deux portées sont bien assez, car trop d\\'enfants nous voleraient notre bonheur. \"\\n\\nMais Khénarthi s\\'en alla trouver Fadomaï et lui tint ce langage :\\n\\n\" Mère, je me sens bien seule, si haut au-dessus du monde que même mon frère Alkosh ne peut venir me rejoindre. \"\\n\\nPrenant pitié de sa fille, Fadomaï fit en sorte de tomber enceinte sans l\\'accord d\\'Ahnurr.\\n\\nEt Fadomaï donna vie à Ja-Kha\\'jay, symbolisant les lunes et leurs phases, mais aussi à Nirni, incarnant les sables majestueux et les forêts luxuriantes, et enfin à Azura, l\\'aube et le crépuscule.\\n\\nDès le premier jour, Nirni et Azura s\\'affrontèrent pour s\\'approprier l\\'amour de leur mère.\\n\\nAhnurr vint rejoindre Fadomaï alors qu\\'elle n\\'avait pas fini d\\'accoucher. Fou de rage, il la frappa et elle s\\'enfuit pour donner vie au reste de sa portée dans la Grande nuit. Apprenant ce qui s\\'était passé, les enfants de Fadomaï se réunirent auprès d\\'elle afin de la protéger de la colère d\\'Ahnurr.\\n\\nEt Fadomaï donna naissance à Lorkhaj, le dernier de sa portée, au sein de la Grande nuit. Et la Grande nuit emplit le coeur de Lorkhaj. Quand il vint à la vie, la Grande nuit se donna le nom de Namiira.\\n',},['Id']=1034,['SizeZ']=48,['EffectType']=8501,['Alpha']=1,['SizeY']=48,['Roll']=0,['Contrast']=1,['X']=32097,['Y']=21393,},[32]={['Z']=19470,['Groups']=0,['Pitch']=4.712564,['SizeX']=43.456456,['Color']=826,['Yaw']=5.672320,['MetaData']={['title']='Parole d\\'Ahnissi, mère de clan',['message']='Tome III\\n\\nFadomaï comprit que sa dernière heure approchait. Elle s\\'adressa à ses enfants en ces termes :\\n\\n\" Ja-Kha\\'jay, à toi, je donne le Treillis, car qu\\'existe-t-il de plus stable que les phases de la lune ? Tes éternelles révolutions nous protégeront de l\\'ire d\\'Ahnurr. \"\\n\\nEt les lunes s\\'en allèrent pour prendre leur place dans les cieux. Grognant de rage, Ahnurr secoua la Grande nuit, mais sans parvenir à franchir le treillis.\\n\\nEt Fadomaï de poursuivre :\\n\\n\" Nirni, c\\'est à toi que je fais mon plus grand cadeau. Tu donneras la vie comme je l\\'ai fait aujourd\\'hui. \"\\n\\nVoyant qu\\'Azura n\\'avait rien reçu, Nirni partit en souriant.\\n\\nTous les enfants s\\'en allèrent, exception faite d\\'Azura. Et Fadomaï lui dit : \" A toi, ma fille préférée, je lègue le plus précieux de mes cadeaux. Je vais te dévoiler mes secrets. \"\\n\\nCe disant, elle révéla ses trois secrets.\\n\\nEt elle poursuivit : \" Quand Nirni aura le ventre rond de ses enfants, prends-en un et transforme-le. Utilise-le pour créer le peuple le plus beau, le plus rapide et le plus intelligent qui soit. Quand tu l\\'auras fait, donne à tes fils le nom de Khajiits. \"\\n\\nEt elle ajouta : \" Les Khajiits doivent être les meilleurs grimpeurs car, si Masser et Secunda échouent, ils devront escalader le souffle de Khénarthi pour remettre les lunes sur leur trajectoire. \"\\n\\nEt elle dit aussi : \" Les Khajiits doivent être les plus grands fourbes, car il leur faudra toujours cacher leur véritable nature aux enfants d\\'Ahnurr. \"\\n\\nEt elle dit enfin : \" Les Khajiits doivent être les plus grands survivants, car Nirni sera jalouse d\\'eux et rendra ses forêts et ses déserts rudes et inhospitaliers, et toujours ils connaîtront la faim et devront se battre contre ta soeur. \"\\nSur ces mots, Fadomaï mourut. ',},['Id']=1035,['SizeZ']=46,['EffectType']=8501,['Alpha']=1,['SizeY']=46,['Roll']=0,['Contrast']=1.160000,['X']=31421,['Y']=21327,},[33]={['Z']=19472,['Groups']=0,['Pitch']=1.570971,['SizeX']=38.456456,['Color']=353026,['Yaw']=0.174533,['MetaData']={['title']='Parole d\\'Ahnissi, mère de clan',['message']='Tome IV\\n\\nAprès un grand nombre de phases, Nirni vint trouver Lorkhaj pour lui dire ceci : \" Lorkhaj, Fadomaï m\\'a demandé de donner vie à de nombreux enfants, mais il n\\'y a pas de place pour eux. \"\\n\\nEt Lorkhaj lui répondit : \" Je vais créer un lieu pour tes enfants et t\\'y amènerai afin que tu puisses leur donner la vie. \"\\n\\nMais le coeur de Lorkhaj était empli de la Grande nuit et il trahit ses frères et soeurs, les enfermant en compagnie de Nirni dans l\\'endroit qu\\'il avait créé. Beaucoup d\\'enfants de Fadomaï s\\'enfuirent pour devenir les étoiles, mais de nombreux autres périrent et les survivants restèrent pour châtier Lorkhaj.\\n\\nLes enfants de Fadomaï arrachèrent le coeur de Lorkhaj et l\\'enfouirent profondément en Nirni, disant : \" Nous te maudissons, malfaisant Lorkhaj, et te condamnons à vivre en Nirni pendant de nombreuses phases. \"\\n\\nMais Nirni pardonna bientôt à Lorkhaj, car elle avait le pouvoir d\\'enfanter. Elle emplit son ventre de multiples enfants, mais ses yeux s\\'embuèrent de larmes quand elle vit que ses préférés, le peuple de la forêt, ne la reconnaissaient pas.\\n\\nAzura vint alors la trouver en lui disant : \" Cesse de pleurer, ma pauvre Nirni. Je vais t\\'offrir un nouveau peuple. \"\\n\\nNirni arrêta de sangloter et Azura chuchota le Premier secret aux lunes, qui s\\'écartèrent pour la laisser passer. Et Azura s\\'empara du peuple de la forêt, déchiré entre l\\'homme et l\\'animal, pour le placer dans les plus accueillants déserts et les plus belles forêts de Nirni. Dans sa grande sagesse, elle conféra à ses représentants des formes multiples, qui chacune pourraient remplir un besoin particulier. Et elle leur donna le nom de Khajiits, en leur révélant le Deuxième secret ainsi que la valeur du silence.',},['Id']=1036,['SizeZ']=47,['EffectType']=8501,['Alpha']=1,['SizeY']=47,['Roll']=0,['Contrast']=0.750000,['X']=31750,['Y']=21760,},[34]={['Z']=20348,['Groups']=0,['Pitch']=4.712564,['SizeX']=40.456456,['Color']=102439,['Yaw']=2.879793,['MetaData']={['title']='Parole d\\'Ahnissi, mère de clan',['message']='Tome V\\n\\nEnfin, Azura répéta le Troisième secret et la clarté des lunes devint sucre sur les marais.\\n\\nMais Y\\'ffer avait entendu le Premier secret, ce qui lui avait permis de suivre Azura. Détestant les cachotteries, il alla révéler à Nirni le tour qu\\'Azura lui avait joué. Alors, Nirni rendit les déserts brûlants et les sables abrasifs, les forêts moites et leurs habitants venimeux. Pour remercier Y\\'ffer, elle lui permit à lui aussi de transformer le peuple de la forêt. Mais Y\\'ffer n\\'avait pas la sagesse d\\'Azura, et il fit de ses enfants des Elfes, les dissociant �� tout jamais des arbres et des animaux. Il leur donna le nom de Bosmers et, à compter de ce jour, plus jamais les Elfes et les Khajiits n\\'ont partagé la même litière.\\n\\n                                    SN\\n\\nEt comme Y\\'ffer n\\'avait pas le goût de la discrétion, il hurla le Premier secret d\\'un bout à l\\'autre des cieux jusqu\\'a son dernier souffle, de sorte que tous les enfants de Fadomaï acquirent le pouvoir de franchir le Treillis. Mais, dans sa grande sagesse, Azura boucha les oreilles d\\'Ahnurr et de Lorkhaj, afin qu\\'eux seuls n\\'entendent pas le mot magique. ',},['Id']=1037,['SizeZ']=47,['EffectType']=8501,['Alpha']=1,['SizeY']=47,['Roll']=0,['Contrast']=1,['X']=31304,['Y']=21296,},[35]={['Z']=24754,['Groups']=0,['Pitch']=0,['SizeX']=160,['Color']=356374,['Yaw']=5.061455,['MetaData']={['message']='Brisez l\\'urne d\\'elsweyr',},['Id']=1038,['SizeZ']=20,['EffectType']=4403,['Alpha']=1,['SizeY']=20,['Roll']=0,['Contrast']=1,['X']=42351,['Y']=21878,},[36]={['Z']=24899,['Groups']=0,['Pitch']=0,['SizeX']=6.456456,['Color']=999295,['Yaw']=0.785398,['MetaData']={['title']='A L\\'AIDE',['message']='\\n\\n\\n\\n\\nVite!                             brûlez les!',},['Id']=1039,['SizeZ']=10,['EffectType']=8503,['Alpha']=1,['SizeY']=10,['Roll']=0,['Contrast']=1,['X']=36628,['Y']=21602,},[37]={['X']=36580,['Pitch']=0,['Color']=140499,['Z']=18046,['Yaw']=1.570796,['Y']=21736,['Roll']=0,['SizeZ']=1000,['EffectType']=871,['Alpha']=1,['SizeY']=1000,['Groups']=0,['Contrast']=1.750000,['Id']=1040,['SizeX']=1000,},[38]={['X']=33891,['Pitch']=0,['Color']=271699,['Z']=18126,['Yaw']=1.570796,['Y']=21738,['Roll']=0,['SizeZ']=1020,['EffectType']=871,['Alpha']=1,['SizeY']=1020,['Groups']=0,['Contrast']=1.790000,['Id']=1041,['SizeX']=1020,},[39]={['X']=34581,['Pitch']=0,['Color']=111299,['Z']=17329,['Yaw']=1.570796,['Y']=21303,['Roll']=0,['SizeZ']=1000,['EffectType']=871,['Alpha']=1,['SizeY']=1000,['Groups']=0,['Contrast']=1.810000,['Id']=1042,['SizeX']=1000,},[40]={['X']=34190,['Pitch']=0,['Color']=180899,['Z']=19193,['Yaw']=1.570796,['Y']=21305,['Roll']=0,['SizeZ']=1000,['EffectType']=871,['Alpha']=1,['SizeY']=1000,['Groups']=0,['Contrast']=1.740000,['Id']=1043,['SizeX']=1000,},[41]={['X']=35708,['Pitch']=0,['Color']=241599,['Z']=16780,['Yaw']=4.712389,['Y']=21745,['Roll']=0,['SizeZ']=1000,['EffectType']=871,['Alpha']=1,['SizeY']=1000,['Groups']=0,['Contrast']=1.750000,['Id']=1044,['SizeX']=1000,},[42]={['X']=35309,['Pitch']=0,['Color']=131199,['Z']=19902,['Yaw']=0,['Y']=21420,['Roll']=0,['SizeZ']=1000,['EffectType']=871,['Alpha']=1,['SizeY']=1000,['Groups']=0,['Contrast']=1.760000,['Id']=1045,['SizeX']=1000,},[43]={['Z']=19211,['Groups']=0,['Pitch']=4.712564,['SizeX']=26.456456,['Color']=213122,['Yaw']=1.483530,['MetaData']={['title']='Ta\\'agra',['message']='Au cours de mes voyages en Elsweyr, j\\'ai pu apprendre quelques mots de Ta\\'agra la langue des Khajiits.\\n\\nFusozay Var Var est souvent entendu et signifie profiter de la vie. Tout comme Nookoh qui veut dire ne pas s\\'inquiéter.\\n\\nSi il y a un mot que vous risquez d\\'entendre très souvent c\\'est le suivant: Je\\'m\\'ath. Il est utilisé comme tel ou dans des expressions variées mais fait référence à cette épice que ce peuple affectionne particulièrement: le sucre-lune.\\n\\nQuelques insultes sont toujours utiles également pour comprendre quand vous êtes l\\'objet de moquerie. Ainsi si vous entendez prononcer les mots Jeek, Renreejee ou Jekosiit à vous de voir si vous avez de quoi leur retourner le compliment. vous pouvez aussi Lhajiito ou en d\\'autre terme vous enfuir!\\n\\n\\n\\n',},['Id']=1046,['SizeZ']=30,['EffectType']=8501,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=1,['X']=33060,['Y']=23135,},[44]={['Z']=17724,['Groups']=0,['Pitch']=4.715880,['SizeX']=26.456456,['Color']=486597,['Yaw']=0.003491,['MetaData']={['title']='Message ',['message']='\\n\\nNous avons trouvé une étrange inscription qui doit pouvoir nous aider à sortir d\\'ici:\\n\\n\"Les lunes réveleront le secret si le Khajiit sait lui murmurer sa nouvelle fourrure.\"\\n\\nJ\\'dazo nous a expliqué que les fourrures étaient les formes sous lesquels naissent les khajiits selon les lunes. \\nJe pense qu\\'il y a donc un rapport entre ces symboles au sol et la fourrure que nous devons dire à haut voix. \\n\\nNous n\\'avons pas encore trouvé celle dont il s\\'agit par contre... \\nMathias est persuadé que la réponse est forcément dans ces livres.',},['Id']=1047,['SizeZ']=30,['EffectType']=8501,['Alpha']=1,['SizeY']=30,['Roll']=0,['Contrast']=0.700000,['X']=29387,['Y']=21506,},[45]={['Z']=21884,['Groups']=0,['Pitch']=0,['SizeX']=60,['Color']=61017,['Yaw']=5.180137,['MetaData']={['message']='KHA',},['Id']=1048,['SizeZ']=40,['EffectType']=4404,['Alpha']=1,['SizeY']=40,['Roll']=0,['Contrast']=0.620000,['X']=37462,['Y']=22122,},[46]={['Z']=21971,['Groups']=0,['Pitch']=0,['SizeX']=60,['Color']=61017,['Yaw']=5.176647,['MetaData']={['message']='LLE',},['Id']=1049,['SizeZ']=40,['EffectType']=4404,['Alpha']=1,['SizeY']=40,['Roll']=0,['Contrast']=0.620000,['X']=37506,['Y']=22122,},[47]={['Z']=22061,['Groups']=0,['Pitch']=0,['SizeX']=60,['Color']=61017,['Yaw']=5.180137,['MetaData']={['message']='JA',},['Id']=1050,['SizeZ']=40,['EffectType']=4404,['Alpha']=1,['SizeY']=40,['Roll']=0,['Contrast']=0.620000,['X']=37552,['Y']=22124,},[48]={['Z']=22062,['Groups']=0,['Pitch']=0,['SizeX']=60,['Color']=61017,['Yaw']=5.180137,['MetaData']={['message']='MAA',},['Id']=1051,['SizeZ']=40,['EffectType']=4404,['Alpha']=1,['SizeY']=40,['Roll']=0,['Contrast']=0.620000,['X']=37552,['Y']=22298,},[49]={['Z']=22328,['Groups']=0,['Pitch']=0,['SizeX']=60,['Color']=61017,['Yaw']=5.180137,['MetaData']={['message']='VAR',},['Id']=1052,['SizeZ']=40,['EffectType']=4404,['Alpha']=1,['SizeY']=40,['Ro