']=83600,['Roll']=0,['Z']=92941,['SizeY']=13,['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=3797,['Pitch']=4.714134,},[56]={['Color']=199,['Y']=37803,['EffectType']=880,['Yaw']=5.070181,['SizeX']=36,['SizeZ']=16,['X']=83589,['Roll']=0,['Z']=92910,['SizeY']=16,['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=3798,['Pitch']=4.714134,},[57]={['Color']=63,['Y']=37935,['EffectType']=462,['Yaw']=3.141600,['SizeX']=760,['SizeZ']=780,['X']=83628,['Roll']=0,['Z']=90573,['SizeY']=780,['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=3799,['Pitch']=0,},[58]={['Y']=37142,['Color']=269799,['Id']=3800,['EffectType']=8502,['Yaw']=3.141593,['SizeX']=66.456456,['SizeZ']=70,['Alpha']=0,['Z']=84791,['SizeY']=70,['MetaData']={['title']='The Dark Fortress',['message']='\\nThis is the Dark Fortress of Gandalf the Obscure an evil Dreadlord and minion of Molag Bal.\\n                                « »\\n\\nEager to uncover the secrets of the forbidden ritual, Gandalf studied and researched in his daedric library day and night.\\n\\nTo verify his gained knowledge he sacrificed countless poor souls in bloody experiments.\\n\\nFinally, he discovered how to open a portal to an ancient ritual site deep under this fortress.\\n\\n                                « »\\n\\nFollow Gandalf\\'s bloody tracks to find the portal in his hidden dungeon.\\n\\nBut be warned, the path to the ritual requires \\na brave soul that has no fear of heights!\\n\\n\\n\\n                                �� »\\n\\nThe Ritual of Fire\\n\\nTo prove you are worthy, stand in the middle of the ring of fire and praise Molag Bal. \\n\\nFail, and you will be condemned to burn in all eternity!\\n\\n\\nHint:\\nIn this evil realm, you may have to literally walk over dead bodies to succeed!',},['Contrast']=1,['Groups']=1,['Roll']=0,['X']=83085,['Pitch']=5.497787,},[59]={['Y']=37888,['Color']=249955,['Id']=3801,['EffectType']=8501,['Yaw']=0.237365,['SizeX']=46.456456,['SizeZ']=65,['Alpha']=0,['Z']=90960,['SizeY']=65,['MetaData']={['title']='World Domination for Dummies',['message']='by Simone Haruko Smith\\n\\nSo you want to take over the world. Good for you! That makes two of us. And obviously, only one of us is going to make it all the way. But what the heck, I\\'m a magnanimous megalomaniac- I\\'ll share the secrets to world domination with you. Let\\'s race for it, shall we? Winner takes all. Literally.\\n\\nWhat follows is a simple guide on how to dominate the world. Follow these steps and you just might have a shot.\\n\\nTHE PLAN\\nNobody is taking over ANYTHING without a plan. You won\\'t even be able to take over management at your local Kwik-E-Mart without a plan, let alone the entire world. So start planning.\\n\\nStart with the end goal of world domination. Add your current place in the world (something embarrassingly low, I imagine). Now establish some midpoints- places you\\'ll stop along the way to supreme power.\\n\\nNow- how are you going to get from midpoint to midpoint? This is where action plans come in. As conditions are likely to change when you reach even your first stopping point, only worry about plotting your actions from point A to point B at this point. Once you reach point B, you must re-evaluate your position and abilities and alter your gameplan accordingly.\\n\\nYour initial plans of action, however, must be clear, concise, and broken down into bite-sized pieces.  If your action plan does not guide every move you make, from waking up in the morning to collapsing into bed (or hanging upside down in your cave, as I do) at night, you will find your chances of success crumbling faster than you can say Roman Empire.\\n\\nDITCH THE DEADWEIGHT\\nFriends don\\'t let friends take over the world. No, really. They\\'re deadweight. Time suckers. Liabilities.\\n\\nIf taking over the world is a real priority of yours, you will have to replace real friends with your cold, hard ...',},['Contrast']=1,['Groups']=1,['Roll']=0,['X']=85886,['Pitch']=4.712564,},[60]={['Y']=38796,['Color']=9908,['Id']=3803,['EffectType']=8503,['Yaw']=4.714134,['SizeX']=46.456456,['SizeZ']=50,['Alpha']=0,['Z']=93846,['SizeY']=50,['MetaData']={['title']='Daedric Research',['message']='After years of research using The Imperial Library, UESP, and the Elder Scrolls themselves I have established the spheres of influence the Daedric Princes have in the Earth realm.\\n\\nAzura, Daedric Prince of Insecure Girlfriends\\n\\nBoethiah, Daedric Prince of Git Gud\\n\\nMephala, Daedric Prince of Indecisiveness\\n\\nMolag Bal, Daedric Prince of Edgy 14 Year Old 4Chan kids\\n\\nMehrunes Dagon, Daedric Prince of Toddlers\\n\\nVaermina, Daedric Prince of Anxiety and bad sleep\\n\\nPeryite, Daedric Prince of Anti Vaxxers\\n\\nClavicus Vile, Daedric Prince of Used Car Salesmen\\n\\nHircine, Daedric Prince of Chads\\n\\nSanguine, Daedric Prince of Frat Boys\\n\\nHermaeus Mora, Daedric Prince of Nerds\\n\\nMalacath, Daedric Prince of IBS\\n\\nNocturnal, Daedric Prince of Goth gfs\\n\\nMeridia, Daedric Prince of Basic Bitches\\n\\nNamira, Daedric Prince of Ugly Chicks\\n\\nSheogorath, Daedric Prince of Scene Kids that go \"omg I like cheese I\\'m so random!\"\\n\\nJyggalag, Daedric Prince of \"They\\'re Not Rocks They\\'re Minerals\"\\n\\n© https://www.facebook.com/140316566651857/posts/after-years-of-research-using-the-imperial-library-uesp-and-the-elder-scrolls-th/255575455125967/',},['Contrast']=1,['Groups']=1,['Roll']=3.141767,['X']=85389,['Pitch']=4.724606,},[61]={['Color']=0,['Y']=36927,['EffectType']=402,['Yaw']=5.668830,['SizeX']=26512,['SizeZ']=24512,['X']=84195,['Roll']=0,['Z']=92139,['SizeY']=24512,['Alpha']=0.940000,['Groups']=0,['Contrast']=1,['Id']=3739,['Pitch']=1.570970,},[62]={['Y']=37034,['Color']=999999,['Id']=5704,['EffectType']=4500,['Yaw']=0,['SizeX']=20,['SizeZ']=400,['Alpha']=1,['Z']=83436,['SizeY']=400,['MetaData']={['owner']='@aegon65',['houseid']=42,},['Contrast']=4,['Groups']=0,['Roll']=0,['X']=83607,['Pitch']=0,},},},[2]={['Version']='16.0.9',['TS']=1610271953,[