['MetaData']={['title']='Welcome to Rosenstein\\'s Blood Incorporated!',['message']='Good evening, appreciated visitor!\\n\\nThe Rosenstein dynasty has always been famous for their eagerness for quality and exquisite taste. Founded by our beloved ancestor Lord Vladimir Rosenstein in 2E 89, Rosenstein\\'s Blood Incorporated is just one branch of the family business, keeping on the tradition of manufacturing products which throughout the millenia aimed to stand out even the highest standards. \"Impossible\" is a word that we banned from our vocabulary ages ago and nowadays only use it when one of our so called competitors might claim to have designed a product better than one in our assortment.\\n\\nBut enough of words, now we would like to invite you to a tour through our facility! Simply follow the numbers so you will understand the steps of production which need to be precisely followed by our eployees. And when you have finished your sightseeing of the finest raw materials and ingredients, the most elaborate machinery and highest production standards, supervised by the most carefully selected and best trained staff one can find, we would love you to try the final result yourself - the most exquisite blood ever produced throughout the entirety of Nirn .\\n\\nEnjoy your stay and recommend us further\\nThe Rosensteins',},['SizeX']=45,['Id']=1330,['Pitch']=5.239478,['Roll']=0,['Groups']=0,},[10]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=118885,['Y']=52139,['Yaw']=3.937463,['X']=104350,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='Raw material reception',['message']='Appreciated visitor! You are right now taking behold of the place where our rare and highly sought after raw materials are received. If you would like to take a look to the left and right, you can watch how they are introduced to the initial production step - the extraction of all remaining body fluids except the blood. This is done so there is no risk of any kinds of contamination and impurity to the product we present to our fastidious customers.\\n\\nNow let us continue on the inside of the facility!',},['SizeX']=46.456456,['Id']=1331,['Pitch']=5.239478,['Roll']=0,['Groups']=0,},[11]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=119850,['Y']=33699,['Yaw']=3.926991,['X']=105490,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='History of the Rosenstein dynasty part 1',['message']='Appreciated visitor, if you do not mind we would like to set you back in time and present you with a guide through the history of our dynasty which reaches back to the earliest ages when those of our kind first saw the light of the wonderful world of Nirn.\\n\\n1E 2915\\nRooted in the ancient dynasty of Ravenwatch, our beloved ancestor Vladimir Rosenstein is born in Alinor, Summerset under highly dangerous circumstances while the War Of The Uvichil takes place and devastates the entire country. His parents, Moimir and Sedferna Rosenstein have to leave their homeplace with their newborn son and find refuge in the city of Riften. Here the boy is raised and soon discoveres his enormous capabilities regarding manufacturing and trade of the finest, highest priced products customers can buy.\\n\\n\\n\\n2E 89\\nAfter centuries of service under the most recommended traders and manfactures, having visited all the coasts and cities throughout the Aurbis, Vladimir decides to put his own business into existence. After several years of seeking customers and business partners The Rosenstein Group is founded with The Rosenstein Jewelry Workshop, The Rosenstein Blacksmith Factory, Rosenstein\\'s Stud Farms and last, but not least, Rosensteins Blood Incorporated. His idea, which has been successful until right now, was that Vampirism had to find a way into acceptance to the whole variety of species which populate Nirn. Vampires should no longer have the necessity of biting people to feed on but to have the opportunity to purchase the blood they need to survive from his company. And, they way he was, he pursued to produce the product to the most outstanding quality possible. This was the beginning of Rosenstein\\'s Blood Incorporated. Today, many centuries later, his legacy is still alive.',},['SizeX']=46.456456,['Id']=1334,['Pitch']=5.235988,['Roll']=0,['Groups']=0,},[12]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=119908,['Y']=33699,['Yaw']=3.926991,['X']=105434,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='History of the Rosenstein dynasty part 2',['message']='2E 112\\nAfter decades of pursuit Potentate Versidue Shaie decides to reprieve the Rosenstein family and to put them into the rank of nobles. Vladimir Rosenstein receives the title of Lord Rosenstein.\\n\\n2E 185\\nLord Rosenstein dies from a desease unknown at this point of time. Later it was revealed that a very rare and highly infectuous type of bacteria was responsible for his death, the so called Impostor Cell. Investigations never reached to a point to exactly define the origin of the bacteria but it is highly supposed to have been an artificial product made for assasination. His first born son Ludvig takes his place as the owner and CEO of the Rosenstein Group.\\n\\n2E 223\\nLudvig Rosenstein proves his position as he has to fend off various attacks by other craftsmen and traders which are aimed to undermine the contracts with his partners as well as the credibility towards his customers. His workers report attempts of bribery and sabotage at the company\\'s facilities. Nevertheless no associations to his father\\'s death can be made evident.\\n\\n2E 323\\nLudvig Rosenstein marries his wife Alastra.\\n\\n2E 389\\nA new face appears in the dynasty. Ludvig and Alastra Rosenstein happily announce the birth of their first daughter Jezebel.\\n\\n2E 401\\nLudvig\\'s and Alatras\\'s second child is born. It is a son who is given the name Robard. His aunt Frieda, first born daughter of Jezebel and her husband Konrad, will play a big part in his life, teaching him writing, mathematics and the high art of trading. She knows the latest prices, has the most sought after blueprints and manufacturing skills and is in steady connection to the best traders and adventurers in the known world.',},['SizeX']=46.456460,['Id']=1335,['Pitch']=5.235988,['Roll']=0,['Groups']=0,},[13]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=119964,['Y']=33699,['Yaw']=3.940953,['X']=105378,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='History of the Rosenstein dynasty part 3',['message']='2E 456\\nWith the advice of his aunt Frieda in combination with his own wisdom Robard Rosenstein manages to place the trademark of the Rosenstein Group all over the Aurbis. \\n\\n2E 521\\nHaving met a man going by the name of Mannimarco, Robards next project is in the making: To open up business outside of Nirn, making the companies products available for sale at places formerly unknown. His aunt Frieda expresses her concerns about the credibility of the man, but Robard decides to carry on.\\n\\n2E 546\\nThe person called Mannimarco is now Robard\\'s best companion. He no longer seeks the advice of his aunt Frieda, who has helped him for decades to take the company to the highest state one could ever think of. He is not even paying her any salary anymore. Mannimarco has taken control over Robard\\'s mind in a way that he will never again listen to anyone but him. Mannimarco even offered a contract with a daedric prince going by the name of Molag Bal who\\'s aim is to possess every soul inhabiting Nirn. With the support of Molag Bal, Robard hopes to be the only trader in the world to sell anything to people, no matter what and no matter the price.\\n\\n2E 583\\nMolag Bal demands the soul of Robard\\'s aunt Frieda. In return he promises to make Robard the richest man in Nirn. Robard agrees and Frieda Rosenstein is taken to Coldhaven, having lost her soul, being nothing but an empty vessel.\\nBut they do not know that rescue is on the way for Frieda Rosenstein. Varen Aquilarios, also known as The Prophet, a Nord called Lyris Titanborn, a Redguard named Sai Sahan and a man of unknown origin calling himself Abnur Tharn help her escape from her prison, defeat Molag Bal and get back her soul. She takes back control and is now the CEO of the Rosenstein Group. Robard Rosenstein was never seen again.',},['SizeX']=46.456460,['Id']=1336,['Pitch']=5.235988,['Roll']=0,['Groups']=0,},[14]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=124229,['Y']=33730,['Yaw']=3.923500,['X']=109792,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='The Powerhouse',['message']='Appreciated visitor! You are now inside the factories own powerhouse where we produce all the energy required to keep our processes going. The generators are capable of delivering 210.000 to 580.000 Kilowatts so we constantly have enough capacity make our intermediate products come to life! You can see some of them in this room if you have the patience to take a look.',},['SizeX']=46.456460,['Id']=1337,['Pitch']=5.235988,['Roll']=0,['Groups']=0,},[15]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=122599,['Y']=33699,['Yaw']=2.357940,['X']=103128,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='The Refinery',['message']='Here, appreciated visitor, the raw materials are enhanced with, let\\'s say, some of the best parts of other organisms so the quality of the final product can be maintained in the way we like it. And, of course, the way you like it, right?',},['SizeX']=46.456456,['Id']=1338,['Pitch']=5.235988,['Roll']=0,['Groups']=0,},[16]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=125966,['Y']=39203,['Yaw']=5.511750,['X']=108741,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='Re-Creation',['message']='Thank you for coming this far, appreciated customer. Here the enhanced material is being placed for further inspection. Most of the bodies are put back to the machinery for blood extraction, but a few of them are even good enough to serve at operating switches and observing quality. You might have seen some of them on your visit at the powerhouse.',},['SizeX']=46.456456,['Id']=1339,['Pitch']=5.229006,['Roll']=0,['Groups']=0,},[17]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=128320,['Y']=98076,['Yaw']=4.698426,['X']=120051,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='Barreling station',['message']='Here, appreciated visitor, the final step of producing the finest blood around the Aurbis is taking place. The exquisite juice you enjoy so much is barrelled now and put on stock so we will always be able to deliver you when you place your order. Oh, and if this just awakened you appetite, you are welcome to try a sample of our product. Simply proceed to the back of the room and let us know what you think of it.',},['SizeX']=46.456456,['Id']=1348,['Pitch']=5.260422,['Roll']=0,['Groups']=0,},[18]={['Color']=102439,['Contrast']=1,['Alpha']=1,['EffectType']=8502,['Z']=125770,['Y']=71087,['Yaw']=5.522222,['X']=112176,['SizeZ']=50,['SizeY']=50,['MetaData']={['title']='Delivery portal',['message']='And now the final station of your tour around our factory, appreciated visitor! Here you wittness the perfection of logistics required to deliver our product to customers all over the Aurbis. Our portal is capable of processing 200 orders per minute and puts us to the ability to satisfy customers almost immediately after their orders were placed. It was designed for material transport only, so please do not be disappointed that we blocked it for the use of living beings.\\n\\nIf we were able to trigger your interest of placing an order of some barrels of the best blood ever known, you should visit one of our authorized traders or simply go to rosenstein.nirn and register. Your order will then be delivered to the coordinates or your choice. Being a vampire was never that easy, and as some might say, never that tasty. \\n\\nWe, the Rosensteins, hope that you have enjoyed your stay at our facility and thank you for your visit.',},['SizeX']=46.456456,['Id']=1349,['Pitch']=5.256932,['Roll']=0,['Groups']=0,},[19]={['Color']=396199,['Contrast']=1,['Alpha']=1,['EffectType']=4404,['Z']=118945,['Y']=52185,['Yaw']=3.939208,['X']=104352,['SizeZ']=100,['SizeY']=100,['MetaData']={['message']='1',},['SizeX']=80,['Id']=1359,['Pitch']=0,['Roll']=0,['Groups']=0,},[20]={['Color']=375599,['Contrast']=1,['Alpha']=1,['EffectType']=4404,['Z']=124297,['Y']=33773,['Yaw']=3.926991,['X']=109781,['SizeZ']=100,['SizeY']=100,['MetaData']={['message']='2',},['SizeX']=100,['Id']=1360,['Pitch']=0,['Roll']=0,['Groups']=0,},[21]={['Color']=394899,['Contrast']=1,['Alpha']=1,['EffectType']=4404,['Z']=120740,['Y']=33561,['Yaw']=2.356194,['X']=104775,['SizeZ']=100,['SizeY']=100,['MetaData']={['message']='3',},['SizeX']=100,['Id']=1361,['Pitch']=4.712564,['Roll']=0,['Groups']=0,},[22]={['Color']=394899,['Alpha']=1,['EffectType']=890,['Z']=120872,['Contrast']=1,['Yaw']=5.497787,['X']=104723,['Y']=33561,['SizeY']=140,['SizeZ']=140,['SizeX']=40,['Id']=1362,['Pitch']=1.570971,['Roll']=0,['Groups']=0,},[23]={['Color']=375099,['Contrast']=1,['Alpha']=1,['EffectType']=4404,['Z']=122560,['Y']=33639,['Yaw']=2.364921,['X']=103119,['SizeZ']=60,['SizeY']=60,['MetaData']={['message']='3',},['SizeX']=60,['Id']=1364,['Pitch']=0,['Roll']=0,['Groups']=0,},[24]={['Color']=355099,['Contrast']=1,['Alpha']=1,['EffectType']=4404,['Z']=125959,['Y']=39241,['Yaw']=5.515240,['X']=108794,['SizeZ']=80,['SizeY']=80,['MetaData']={['message']='4',},['SizeX']=60,['Id']=1365,['Pitch']=0,['Roll']=0,['Groups']=0,},[25]={['Color']=405799,['Contrast']=1,['Alpha']=1,['EffectType']=4404,['Z']=125772,['Y']=71130,['Yaw']=5.518731,['X']=112234,['SizeZ']=80,['SizeY']=80,['MetaData']={['message']='6',},['SizeX']=80,['Id']=1366,['Pitch']=0,['Roll']=0,['Groups']=0,},[26]={['Color']=405799,['Contrast']=1,['Alpha']=1,['EffectType']